Analyze the following news articles for sentiment toward XAUUSD:

[
  { "title": "Gold rises as dollar weakens", "description": "XAU/USD gained as the USD fell after dovish Fed commentary." },
  { "title": "Fed minutes hint at possible rate cuts", "description": "Traders expect lower rates later this year, boosting gold demand." },
  { "title": "Geopolitical tensions ease in Middle East", "description": "Reduced safe-haven demand may weigh on gold prices." }
]

