// n8n Code node (JavaScript) — ALWAYS returns an array of items
try {
  const inputItems = $input.all();
  if (!inputItems.length) {
    return [{ json: { error: "No input items received" } }];
  }

  // ---------- helpers ----------
  const num = v => (v === null || v === undefined || v === "" ? undefined : Number(v));
  const isFiniteNum = v => Number.isFinite(v);

  function toEpochMsLoose(t) {
    if (t === null || t === undefined) return undefined;
    const n = Number(t);
    if (Number.isFinite(n)) return n < 1e12 ? n * 1000 : n; // sec→ms
    if (typeof t === "string") {
      const isoish = t.includes("T") ? t : t.replace(" ", "T");
      const withZ = /Z$/.test(isoish) ? isoish : isoish + "Z";
      const d = new Date(withZ);
      if (!Number.isNaN(d.getTime())) return d.getTime();
    }
    const d = new Date(t);
    return Number.isNaN(d.getTime()) ? undefined : d.getTime();
  }

  function normInterval(raw) {
    if (!raw) return "UNKNOWN";
    const s = String(raw).toLowerCase().replace(/\s+/g, "");
    if (["1m","1min","1minute"].includes(s)) return "1m";
    if (["15m","15min","15minute"].includes(s)) return "15m";
    if (["1h","1hr","1hour"].includes(s)) return "1h";
    return raw;
  }

  function pick(obj, keys) {
    for (const k of keys) {
      if (obj?.[k] !== undefined && obj?.[k] !== null && obj?.[k] !== "") return obj[k];
    }
    return undefined;
  }

  // ---------- gather ----------
  let symbol = "UNKNOWN";
  let timeZone = "UTC";
  const buckets = { "1m": [], "15m": [], "1h": [] };

  for (const item of inputItems) {
    const root = item.json || {};
    const dataArr = Array.isArray(root.data) ? root.data : [];

    for (const block of dataArr) {
      const meta = block.meta || {};
      const vals = Array.isArray(block.values) ? block.values : [];

      if (symbol === "UNKNOWN") {
        const s =
          pick(meta, ["symbol", "pair", "ticker"]) ||
          `${pick(meta, ["currency_base"]) || ""}/${pick(meta, ["currency_quote"]) || ""}`;
        symbol = (s && s !== "/") ? String(s) : "UNKNOWN";
      }
      if (timeZone === "UTC") {
        timeZone = pick(meta, ["timeZone", "timezone", "tz", "zone"]) || "UTC";
      }

      const interval = normInterval(pick(meta, ["interval", "timeframe", "granularity"]));

      for (const row of vals) {
        const epochMs = toEpochMsLoose(pick(row, ["datetime", "time", "timestamp", "ts"]));
        const open  = num(pick(row, ["open", "o"]));
        const high  = num(pick(row, ["high", "h"]));
        const low   = num(pick(row, ["low", "l"]));
        const close = num(pick(row, ["close", "c"]));
        const volume = num(pick(row, ["volume", "v"]));

        if (!Number.isFinite(epochMs) || !Number.isFinite(open) || !Number.isFinite(high) || !Number.isFinite(low) || !Number.isFinite(close)) {
          continue;
        }

        const candle = {
          epochMs,
          isoTime: new Date(epochMs).toISOString(),
          open, high, low, close,
          volume: Number.isFinite(volume) ? volume : null,
        };

        const key = ["1m", "15m", "1h"].includes(interval) ? interval : null;
        if (key) buckets[key].push(candle);
      }
    }
  }

  // de-dupe, sort, cap 100
  for (const key of ["1m", "15m", "1h"]) {
    const byTs = new Map();
    for (const c of buckets[key]) byTs.set(c.epochMs, c);
    const arr = Array.from(byTs.values()).sort((a, b) => a.epochMs - b.epochMs);
    buckets[key] = arr.length > 100 ? arr.slice(-100) : arr;
  }

  const meta = {
    generatedAt: new Date().toISOString(),
    candleCounts: {
      "1m": buckets["1m"].length,
      "15m": buckets["15m"].length,
      "1h": buckets["1h"].length,
    },
  };

  return [{
    json: {
      symbol,
      timeZone,
      intervals: buckets,
      meta,
    }
  }];

} catch (err) {
  // Guarantee an array of items even on error
  return [{ json: { error: true, message: String(err?.message || err) } }];
}
